    false,nt"url": null,nt"notes": "To accomplish eradication of introduced
    arctic fox on Kiska, the FWS is testing and evaluating the toxicant sodium monofluoroacetate
    (Compound 1080). Incumbent upon the FWS during fox eradication is the need to :
    1) evaluate the effect of the treatment on arctic fox, the target species; 2) monitor
    the impact of the eradication program on non-target wildlife, in particular, raptors
    and avian scavengers; and 3) evaluate and document the recolonization and population
